pragma solidity >=0.4.20 <0.9.0;

/**
* the Contract transfer Ethers to Loyal Customers
*/
contract cryptoDorea {

    address _signer;

    /**
    * define constructor to get fund on deploy stage
    */ 
    constructor() payable {

        _signer = msg.sender;

    }

    /**
    * Transfer Ethers to Loyal Customers
    */
    // @param address[] recipients _ the receipnts addresses to be payed in hex format
    function pay(

        address[] memory recipients, 
        uint256  amount, 
        uint256 campaignCount, 
        uint256 shoppingCount,
        bytes32 _hashedMessage, 
        uint8 _v, 
        bytes32 _r, 
        bytes32 _s

    ) public payable{
    
        userAuthorized(_hashedMessage, _v, _r, _s);
        
        require(amount <= address(this).balance, "Insufficient balance");

        if(shoppingCount >= campaignCount){    

            for (uint256 i = 0; i < recipients.length; i++) {

                // Transfer Ether to the receipnt address
                bool success = payable(recipients[i]).send(amount);
                require(success, "Transfer failed");

            }

        }else{

            revert("User not Eligible!");

        }

    }

    /**
    * check if user is authorized to pay
    */
    function userAuthorized(bytes32 _hashedMessage, uint8 _v, bytes32 _r, bytes32 _s) public view {
        
        bytes memory prefix = "\x19Ethereum Signed Message:\n32";

        bytes32 prefixedHashMessage = keccak256(abi.encodePacked(prefix, _hashedMessage));
        address signer = ecrecover(prefixedHashMessage, _v, _r, _s);

        if(signer != _signer){
            revert("User is not Authorized!!!");
        }

    }

